import styled from "styled-components"

const Container = styled.div`
width:100vw;
height:100vh;
background: url("https://images.pexels.com/photos/6984661/pexels-photo-6984661.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940")
`;

const Wrapper = styled.div`

display:flex;
flex-direction: column;
`;

const Form = styled.form`
display:flex;
flex-direction: column;
`;

const Title = styled.h1``;

const Input = styled.input``;

const Agreememt = styled.span``;

const Button = styled.button``;



const Register = () => {
  return (
    <Container>
        <Wrapper>
            <Title>CREATE AN ACCOUNT</Title>
            <Form>
                <Input placeholder="name"/>
                <Input placeholder="last name"/>
                <Input placeholder="username"/>
                <Input placeholder="email"/>
                <Input placeholder="password"/>
                <Input placeholder="confirm password"/>
                <Agreememt>By creating an account, I consent to the processing of my
                    personal data in accordance with the <b>PRIVACY POLICY</b>
                </Agreememt>
                <Button>CREATE</Button>
            </Form>
        </Wrapper>
    </Container>
  )
}

export default Register;
